  or summarized in a manner that prevents the identification of the person or organization
  that submitted the data. The \"rule of three\" and identification of majority allocations\"
  are the primary data suppression methods.n2. Obscure (scramble) or remove the data
  identifier. For some types of data, confidential data Can be released as non-confidential
  if the identity of the person, vessel, company, etc. that submitted the data is
  not included or is scrambled as part of the data that are released.n3. Submitter.
